// Styling


function SearchBar(props){

  const printValue = (e)=>{
    props.setQuery(e)
  }
  return (
    <input className="searchBar"
      onChange={(event) => printValue(e.target.value)}
      placeholder="Search for a cookie name"
    />
  );
};

export default SearchBar;
